import React from "react";
import "./index.css";

const Greeting = () =>{
    const date = new Date();
    const time = date.getHours();
    var greeting = "";
    if(time < 12){
        greeting = "Good Morning";
    }else if(time < 19){
        greeting = "Good AfterNoon";
    }else{
        greeting = "Good Night";
    }

    return(
        <h1>Hello Sir,{greeting}</h1>
    )
};

export default Greeting;
